import React, { useEffect, useState, useContext } from "react";
import {Link, useParams, Navigate} from 'react-router-dom';
import "../aiRequest/css/reqStyle.css";
import {MemberInfoContext} from '../components/MemberInfoContext';

const params = new URLSearchParams(window.location.search);
let groupNo = params.get("groupNo") == null ? '' : params.get("groupNo");

const SrvyData = () => {
    const memberInfo  = useContext(MemberInfoContext);
    const [surveyResults, setSurveyResults] = useState({});

    useEffect(() => {
        console.log("üìå React - API ÏöîÏ≤≠ ÏãúÏûë, groupNo:", groupNo);
        fetch(`http://localhost:9193/api/SrvyData?groupNo=${groupNo}`, {
            method: 'GET'
        })
            .then(response => response.json())
            .then(data => {
                console.log("üìä ÎßåÏ°±ÎèÑ Ï°∞ÏÇ¨ ÌÜµÍ≥Ñ API ÏùëÎãµ Îç∞Ïù¥ÌÑ∞:", data);

                if (data.length > 0) {
                    // Í∞ôÏùÄ srvyCn(ÎßåÏ°±ÎèÑ Ï°∞ÏÇ¨ ÏßàÎ¨∏)ÎÅºÎ¶¨ Í∑∏Î£πÌôî Î∞è totalCount Í∞ÄÏ†∏Ïò§Í∏∞
                    const groupedResults = data.reduce((acc, item) => {
                        // üîπ Í∞úÎ≥Ñ ÏùëÎãµ Îç∞Ïù¥ÌÑ∞ Î°úÍ∑∏ ÌôïÏù∏
                        console.log("üìä Í∞úÎ≥Ñ ÏùëÎãµ Îç∞Ïù¥ÌÑ∞:", item);
                        console.log("üü¢ responsePercentages:", item.responsePercentages);

                        if (!acc[item.srvyCn]) {
                            acc[item.srvyCn] = {
                                totalCount: 0,
                                multipleChoiceResponses: [],  // Í∞ùÍ¥ÄÏãù ÏùëÎãµ Î∞∞Ïó¥
                                textResponses: [], // Îã®ÎãµÌòï ÏùëÎãµ Ï†ÄÏû•Ìï† Î∞∞Ïó¥ Ï∂îÍ∞Ä
                                responsePercentages: {} // Í∞ùÍ¥ÄÏãù ÏùëÎãµ ÌçºÏÑºÌä∏ Ï†ÄÏû•
                            };
                        }
                        // Í∞ùÍ¥ÄÏãù ÏùëÎãµ Ï≤òÎ¶¨
                        if (item.multipleChoiceResponses && item.multipleChoiceResponses.length > 0) {
                            acc[item.srvyCn].multipleChoiceResponses = item.multipleChoiceResponses;
                            acc[item.srvyCn].totalCount = item.multipleChoiceCount;  // Í∞ùÍ¥ÄÏãù ÏùëÎãµ Ïàò Ï∂îÍ∞Ä
                            
                            // Î∞±ÏóîÎìúÏóêÏÑú Î∞õÏùÄ `personPercentage` Í∞íÏùÑ Îß§Ìïë
                            if (item.responsePercentages) {
                                acc[item.srvyCn].responsePercentages = item.responsePercentages;
                        }
                
                        }

                        // Îã®ÎãµÌòï ÏùëÎãµ Ï≤òÎ¶¨
                        if (item.shortAnswerResponses && item.shortAnswerResponses.length > 0) {
                            acc[item.srvyCn].textResponses = item.shortAnswerResponses;
                            acc[item.srvyCn].totalCount += item.shortAnswerResponses.length;  // Îã®ÎãµÌòï ÏùëÎãµ Ïàò Ï∂îÍ∞Ä
                        }
                        return acc;
                    }, {});

                    setSurveyResults(groupedResults);
                } else {
                    console.warn("‚ö†Ô∏è ÎßåÏ°±ÎèÑ Ï°∞ÏÇ¨ Îç∞Ïù¥ÌÑ∞Í∞Ä ÏóÜÏäµÎãàÎã§.");
                }
            })
            .catch(error => {
                console.error("‚ùå Error fetching survey results:", error);
            });
    }, [groupNo]);

    if(memberInfo.loading) {
        return <div>Î°úÎî© Ï§ë...</div>
    }

    if(!memberInfo.email) {
        alert("Î°úÍ∑∏Ïù∏Ïù¥ ÌïÑÏöîÌï©ÎãàÎã§.");
        return <Navigate to="/lgn/Lgn" replace />
    }

    if(memberInfo.grade != 3) {
        alert("Í∂åÌïúÏù¥ ÏóÜÏäµÎãàÎã§.");
        return <Navigate to="/" replace />
    }
    return (
        <div className="aiR-container">
            <h1>üìä Î∂ÑÏÑù ÎßåÏ°±ÎèÑ Ï°∞ÏÇ¨ ÌÜµÍ≥Ñ</h1>
            {Object.keys(surveyResults).length === 0 ? (
                <p>‚ö†Ô∏è ÎßåÏ°±ÎèÑ Ï°∞ÏÇ¨ Îç∞Ïù¥ÌÑ∞Í∞Ä ÏóÜÏäµÎãàÎã§.</p>
            ) : (
                <form>
                    {Object.entries(surveyResults)
                        //.reverse() // Î¨∏Ìï≠ ÏàúÏÑú Î∞òÎåÄÎ°ú Ï†ïÎ†¨
                        .map(([question, { multipleChoiceResponses, responsePercentages, totalCount, textResponses }], qIndex) => (
                            <div className="question" key={qIndex}>
                                <label>{question}</label>

                                {/* Í∞ùÍ¥ÄÏãù ÏùëÎãµ ÌëúÏãú */}
                                {multipleChoiceResponses && multipleChoiceResponses.length > 0 && (
                                    <div className="satisfaction-options">
                                        {multipleChoiceResponses.map((response, index) => {
                                            const percentage = responsePercentages && responsePercentages[index] !== undefined
                                            ? parseFloat(responsePercentages[index])  // Î∞∞Ïó¥ÏóêÏÑú ÌçºÏÑºÌä∏Î•º Í∞ÄÏ†∏ÏôÄÏÑú Ïã§ÏàòÎ°ú Î≥ÄÌôò
                                            : 0;  // Default to 0 if percentage is not found
                                            return (
                                                <div key={index}>
                                                    <input
                                                        type="radio"
                                                        id={`satisfaction-${qIndex}-${index}`}
                                                        name={`satisfaction-${qIndex}`}
                                                        value={response}
                                                        disabled
                                                        checked={false} // ÎùºÎîîÏò§ Î≤ÑÌäºÏù¥ Ìï≠ÏÉÅ ÏÑ†ÌÉùÎêòÏßÄ ÏïäÎèÑÎ°ù
                                                    />
                                                    <label htmlFor={`satisfaction-${qIndex}-${index}`}>
                                                        {response}
                                                    </label>
                                                    <span className="result">{percentage.toFixed(2)}%</span> {/* ÌçºÏÑºÌä∏ ÌëúÏãú */}
                                                </div>
                                            );
                                        })}
                                    </div>
                                )}

                                {/* Îã®ÎãµÌòï ÏùëÎãµ ÌëúÏãú */}
                                {textResponses && textResponses.length > 0 && (
                                    <div className="text-responses">
                                        <h4>Îã®ÎãµÌòï ÏùëÎãµ:</h4>
                                        <ul>
                                            {textResponses.map((text, idx) => (
                                                <li key={idx}>üìù {text}</li>
                                            ))}
                                        </ul>
                                    </div>
                                )}
                             {/* totalCount ÌëúÏãú */}
                             <div className="total-count">
                                    <p>ÏùëÎãµ Ïàò: {totalCount}</p>
                                </div>
                            </div>
                        ))}
                    <div className="submit-section">
                        <button type="button" onClick={() => window.history.back()}>Îí§Î°úÍ∞ÄÍ∏∞</button>
                    </div>
                </form>
            )}
        </div>
    );
};

export default SrvyData;
